import {React} from "react"
import "../css/navItem.css"
import Contact from '../componenets/Contact'
import Books from '../componenets/Books'

export default function NavItem(props){
    const seprateComponent = [7, 8]

    function printList(list){
        return(
            <ul className="item-list">
                {list.map((item, index) => <li  key={index}>{item}</li>)}
            </ul>
        )
    }

    return(
            <div className="main-content item">
                {(seprateComponent.includes(props.data.id)) ? <h1 className="item-title">{props.data.title}</h1> : ""}
                {(props.data.id != 7 && props.data.id != 8) ? <p id="main-text" className="item-main-text">{props.data.mainText}</p> : ""}
                {props.data.hasOwnProperty('list') ? printList(props.data.list) : ""}
                {props.data.id === 8 ?  <Contact /> : ""}
                {props.data.id === 7 ? <Books /> : ""}
            </div>
    )
}
